// UserCard.js
import React from 'react';

const UserCard = ({ user }) => {
  return (
    <div className="bloger">
      <div className="info">
        <img src={user.avatarUrl} alt={`${user.name} ${user.surname}`} />
        <h3>{`${user.name} ${user.surname}`}</h3>
        <p> {user.about}</p>
      </div>
    </div>
  );
};

export default UserCard;
